    { type:"text", placeholder:"Name", marginBottom:"10px"},
    { type:"text", placeholder:"Department", marginBottom:"10px"},
    { type:"text", placeholder:"Email", marginBottom:"10px"},
    { type:"text", placeholder:"Year", marginBottom:"10px"},
    { type:"text", placeholder:"Class"},
    { type:"text", placeholder:"Subject"}




  ]
  return(
    <div className='display'>
    <div>
                <Logo />
            </div>
            <div className='displaycontainer' >
              <div className='displayleft'>
              <div className='displayform'>
              <Form fields={addFields}  txt="ADD"/>


              </div>

              </div>
            </div>

    </div>
  )
 }

 export default Display;
